// FormComponentAnesthesia.js
import React, { useState } from 'react';
import { TextField, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Typography, Button } from '@mui/material';

const FormComponentAnesthesia = ({ title, subjectsData }) => {
  const [rollNumber, setRollNumber] = useState('');
  const [name, setName] = useState('');
  const [soName, setSoName] = useState('');
  const [date, setDate] = useState('');

  const totalMarks = subjectsData.reduce((acc, subject) => acc + subject.internalSecured + subject.theorySecured + subject.practicalSecured, 0);

  const convertToWords = (num) => {
    const a = ['','One','Two','Three','Four','Five','Six','Seven','Eight','Nine','Ten','Eleven','Twelve','Thirteen','Fourteen','Fifteen','Sixteen','Seventeen','Eighteen','Nineteen'];
    const b = ['','', 'Twenty','Thirty','Forty','Fifty','Sixty','Seventy','Eighty','Ninety'];
    if ((num = num.toString()).length > 9) return 'Overflow';
    let n = ('000000000' + num).substr(-9).match(/.{1,3}/g);
    let str = '';
    str += (n[0] != 0) ? (a[Number(n[0])] || b[n[0][0]] + ' ' + a[n[0][1]]) + 'Crore ' : '';
    str += (n[1] != 0) ? (a[Number(n[1])] || b[n[1][0]] + ' ' + a[n[1][1]]) + 'Lakh ' : '';
    str += (n[2] != 0) ? (a[Number(n[2])] || b[n[2][0]] + ' ' + a[n[2][1]]) + 'Thousand ' : '';
    str += (n[3] != 0) ? (a[Number(n[3])] || b[n[3][0]] + ' ' + a[n[3][1]]) + 'Hundred ' : '';
    str += (n[4] != 0) ? ((str != '') ? 'and ' : '') + (a[Number(n[4])] || b[n[4][0]] + ' ' + a[n[4][1]]) + '' : '';
    return str.trim() + ' Only';
  };

  return (
    <div style={{ padding: 20 }}>
      <Typography variant="h5" gutterBottom>{title}</Typography>
      <TextField label="Roll Number" value={rollNumber} onChange={e => setRollNumber(e.target.value)} fullWidth margin="normal" />
      <TextField label="Name" value={name} onChange={e => setName(e.target.value)} fullWidth margin="normal" />
      <TextField label="S/o or D/o" value={soName} onChange={e => setSoName(e.target.value)} fullWidth margin="normal" />
      <TextField label="Date" type="date" value={date} onChange={e => setDate(e.target.value)} fullWidth margin="normal" InputLabelProps={{ shrink: true }} />

      <TableContainer component={Paper} style={{ marginTop: 20 }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Paper</TableCell>
              <TableCell>Subject</TableCell>
              <TableCell>Internal (Max)</TableCell>
              <TableCell>Internal (Secured)</TableCell>
              <TableCell>Theory (Max)</TableCell>
              <TableCell>Theory (Secured)</TableCell>
              <TableCell>Practicals (Max)</TableCell>
              <TableCell>Practicals (Secured)</TableCell>
              <TableCell>Result</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjectsData.map((subject, index) => (
              <TableRow key={index}>
                <TableCell>{index + 1}</TableCell>
                <TableCell>{subject.subject}</TableCell>
                <TableCell>{subject.internalMax}</TableCell>
                <TableCell>{subject.internalSecured}</TableCell>
                <TableCell>{subject.theoryMax}</TableCell>
                <TableCell>{subject.theorySecured}</TableCell>
                <TableCell>{subject.practicalMax}</TableCell>
                <TableCell>{subject.practicalSecured}</TableCell>
                <TableCell>Pass</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Typography variant="h6" style={{ marginTop: 20 }}>Grand Total: {totalMarks}</Typography>
      <Typography variant="h6">Grand Total in Words: {convertToWords(totalMarks)}</Typography>

      <Typography style={{ marginTop: 40 }}>Dated: {date}</Typography>
      <Typography variant="subtitle1" style={{ marginTop: 10 }}><strong>EXECUTIVE REGISTRAR</strong></Typography>
    </div>
  );
};

export default FormComponentAnesthesia;
